export default function Divisores(){
  console.log("Hola desde divisores");

  for (let i = 1; i < 10; i++) {
    if (i % 2 == 0){
      let par = console.log(i);

    }
  }
  <h2>Pares: {par}</h2>


  return(
    <div>
      <h1>Divisores</h1>
    </div>

  )
}
